import React from "react"; 
import './Paging.css'; 
import Pagination from "react-js-pagination"; 

const Paging = ({page, count, setPage}) => { 
  
  return ( 
    <Pagination 
      activePage={page} 
      itemsCountPerPage={5} 
      totalItemsCount={count} 
      pageRangeDisplayed={5} 
      prevPageText={"‹"} 
      nextPageText={"›"} 
      onChange={setPage} 
    /> 
  ); 
}; export default Paging;
